$SD.on('connected', (jsonObj) => connected(jsonObj));
function connected(jsn) {
    /** subscribe to the willAppear and other events */
    // Simple Message
    $SD.on('com.krabs.twitchwatcher.twitchwatcher.willAppear', jsonObj => twitchwatcher.onWillAppear(jsonObj));
    $SD.on('com.krabs.twitchwatcher.twitchwatcher.keyUp', jsonObj => twitchwatcher.onKeyUp(jsonObj));
    $SD.on('com.krabs.twitchwatcher.twitchwatcher.didReceiveSettings', jsonObj => twitchwatcher.onDidReceiveSettings(jsonObj));
    $SD.on('com.krabs.twitchwatcher.twitchwatcher.propertyInspectorDidAppear', jsonObj => {
    });
    $SD.on('com.krabs.twitchwatcher.twitchwatcher.propertyInspectorDidDisappear', jsonObj => {
    });
};

